    "2016-09-01T08:24:35.921990",nt"name": "analysis-neighborhoods-census-tracts-assigned-to-neighborhoods",nt"isopen":
    true,nt"url": null,nt"notes": "The Department of Public Health and the
    Mayoru2019s Office of Housing and Community Development, with support from the Planning
    Department, created 41 neighborhoods by grouping 2010 Census tracts, using common
    real estate and residentsu2019 definitions for the purpose of providing consistency
    in the analysis and reporting of socio-economic, demographic, and environmental
    data, and data on City-funded programs and services. They are not codified in Planning
    Code nor Administrative Code.rnrnThis dataset is produced by assigning Census tracts
    to neighborhoods based on existing neighborhood definitions used by Planning and
    MOHCD. A qualitative assessment is made to identify the appropriate neighborhood
    for a given tract based on an understanding of population distribution and significant
    landmarks. Once all tracts have been assigned a neighborhood, the tracts are combined
    to produce Analysis Neighborhoods which is available at https://data.sfgov.org/d/p5b7-5n3h",nt"license_title":
